import React,{Component} from 'react';
import './Table.css';
// import ReactHTMLTableToExcel from 'react-html-table-to-excel';

export default class Table extends Component{

    constructor(props){
		super(props);

		this.state = {
			studDetails : []

		}
    }
    componentDidMount(){
		// this.getstudData();
	}
    render(){
        return(
            <div className ="pagewrapper slist">
               <table className="table table-stripped table-hovered table-bordered customcss">
                   <thead>
                       <tr>
                           <th>
                               Node_id
                           </th>
                           <th>
                              Name
                           </th>
                       </tr>

                   </thead>
                   <tbody>
                            {
                                this.state.studDetails.length > 0
                                ?
                                    this.state.studDetails.map((stud,index)=>{
                                        return(
                                            <tr key={index}>
                                                <td>{index+1}</td>
                                                <td>{stud.email}</td>
                                            </tr>

                                        )

                                    })
                                :
                                <tr> 
										<td colSpan="12"> Sorry... No Data available! </td>
									</tr>

                             }
                        </tbody>
               </table>
            </div>
        )
    }

}
